import React from "react";
import bgVideo from "../Images/rain.mp4";

function VideoBgSection() {
  return (
    <div>
      <video src={bgVideo} autoPlay muted loop></video>
      <div className="text-on-video"></div>
    </div>
  );
}

export default VideoBgSection;
